  false,\n\t\"url\": null,\n\t\"notes\": \"Photoscience completed the original collection
  and classification of the multiple return LiDAR of Charleston County, South Carolina
  in the winter of 2006-2007. In 2009, Sanborn collected portions of Charleston County
  which were previously uncollected in 2006/7. In 2013, Dewberry was tasked with reviewing,
  updating and merging the original LiDAR products into one continuous data to include
  the 2006-2007 and 2009 separate projects. The 2006/2007 data was separated from
  the 2009 collected points in order to keep the 2 missions separate (collection dates,
  standards, data qualities, etc). The 2006-2007 data was removed by analyzing GPS
  time stamps of the LAS points in order to differentiate by collection year. The
  resulting LAS files left only the 2009 points which represent this project. The
  2007 data already exists at OCM as part of a previous delivery. The nominal point
  spacing for this project is 1.4 meters. Dewberry used proprietary procedures to
  update and reclassify the LAS according to updated project specifications: 1-Unclassified,
  2-Ground, 7-Noise, 8- Model Key Points, 9-Water, 10-Ignored Ground, 13- Points removed
  from bridges and culverts (which were moved to class 15 at OCM).\",\n\t\"license_title\":
